INSERT INTO `cadrelatorios` VALUES (1,'ServIP','select \r\n  cis.chave as CI, \r\n tipocis.tipo,\r\n left(cis.descricao,30) as Descricao,\r\n  sites.nome as Site, \r\n  atributos.valor as IP from cis, \r\natributos,sites,tipocis where (atributos.dicdado_id = 6 or atributos.dicdado_id=10) and atributos.ci_id = cis.id and cis.site_id = sites.id and cis.tipoci_id = tipocis.id order by atributos.valor;','2013-04-18 01:03:13','2013-11-03 14:54:07','IPs dos servidores'),(2,'AlertasCWBGestor','select  status as Status, fornecedores.nome as Fornecedor, sites.nome as Site, concat(tasks.nome,\"-\",tasks.description) as Alerta from tasks,fornecedores,sites where site_id in (4,7) and publica and fornecedores.id = tasks.fornecedor_id and sites.id = tasks.site_id and tasks.ativo=1','2013-04-19 13:55:28','2013-10-21 18:40:27','Alertas para Curitiba e Brasil'),(3,'TodosLinks','Select contratos.codcontrato as Codigo ,left(fornecedores.nome,20) as Fornecedor, FORMAT(contratos.valormensal,0) as \"Valor Mensal\" from contratos, fornecedores where tipocontrato_id=3 and contratos.fornecedor_id = fornecedores.id\r\norder by fornecedor','2013-05-20 17:26:32','2013-10-21 18:48:13',''),(4,'CobrancaServVirtuais','select \r\n       cis.chave as CI,\r\n       cis.owner as Email,\r\n       cis.descricao as Descricao,\r\n       sites.nome as Site, \r\n       \r\n       MAX(IF(atributos.dicdado_id = 16 , atributos.valor, NULL)) as CC,\r\n       MAX(IF(atributos.dicdado_id = 9 , atributos.valor, NULL)) as Servicos\r\n\r\n\r\nfrom \r\n       cis, \r\n       atributos ,\r\n       sites,\r\n       tipocis \r\nwhere \r\n       cis.tipoci_id=32 and \r\n     \r\n\r\n       atributos.ci_id = cis.id and \r\n       cis.site_id = sites.id and \r\n       cis.tipoci_id = tipocis.id \r\ngroup by cis.chave\r\norder by cis.chave;','2013-05-31 01:39:40','2013-05-31 03:35:14',NULL),(5,'ServServicos','select         \r\n    	cis.chave as CI,        \r\n    	cis.owner as Email,        \r\n    	cis.descricao as Descricao,                \r\n    	MAX(IF(atributos.dicdado_id = 16 , atributos.valor, NULL)) as CC ,\r\n    	MAX(IF(atributos.dicdado_id = 26 , atributos.valor, NULL)) as SO          \r\n    from         \r\n        cis,         \r\n        atributos,        \r\n        sites,        \r\n        tipocis  \r\n     where         \r\n        cis.tipoci_id=32 and                \r\n        atributos.ci_id = cis.id and         \r\n        cis.site_id = sites.id and         \r\n        cis.tipoci_id = tipocis.id  \r\n      group by  \r\n        cis.chave \r\n      order by \r\n        cis.chave;','2013-06-13 23:13:09','2013-06-16 20:16:39','CC e SO dos serv virtuais'),(6,'teste','delete * form lixo','2013-10-21 12:42:36','2013-10-21 12:42:36','');
/*!40000 ALTER TABLE `cadrelatorios` ENABLE KEYS */;
