 operadora GVT.','Info',23,1,5,5,'2013-05-16 13:53:33','2013-05-20 19:17:02',0,0,'','[Indisponibilidade  Ligações externas - Boa Vista]',5,'15879',0,NULL,NULL,NULL,NULL,NULL),(680,'Link restabelecido às 10:02 do dia 20/05/2013.\r\n\r\nEstamos com indisponibilidade no acesso de Marechal para a Caixa.\r\n\r\nFoi aberto um chamado e a operadora deu o prazo de 04 horas para a resolução.\r\n','Incidente',23,1,5,4,'2013-05-16 20:31:59','2013-05-20 19:18:12',1,0,'','[Indisponibilidade VPN CAIXA]',4,'789435201305161721',0,NULL,NULL,NULL,NULL,NULL),(681,'Estamos com problemas no tronco chave de Alphaville. Sem a possibilidade de receber e realizar ligações externas.','Aberto',23,1,1,4,'2013-05-20 19:15:08','2013-10-21 14:43:59',1,0,'http://www.globo.com','[TELEFONIA] Tronco chave Alpha.',5,'15890',1,'Mudança',NULL,'teste\r\n',NULL,''),(682,'Nenhum impacto é previsto, pois antes da atualização do SO, todas as VMs serão migradas para outras máquinas \r\npertencentes ao Vcenter.','Mudança',7,1,5,3,'2013-05-20 19:15:27','2013-05-20 19:15:27',1,0,'http://jira.brq.com/browse/INFR-2948','Atualização do SO ESXi para 5.0',47,'',0,NULL,NULL,NULL,NULL,NULL),(683,'O link Está normalizado.\r\n\r\nO link mainframe contingência encontra-se indisponível no site Alphaville.\r\n\r\nEstamos em contato com a operadora.','Incidente',23,1,5,6,'2013-05-20 19:58:23','2013-05-20 22:20:00',1,0,'','[BRAD.MAINFRAME.AMS.SP]',11,'1512025',0,NULL,NULL,NULL,NULL,NULL),(684,'10:50Hs \r\n\r\nLink Reparado pela Operadora.\r\n\r\nA MPLS do site de BSB esta fora do ar com início às 09:30hs\r\n\r\nServiços interrompidos temporariamente: \r\n\r\nTelefonia\r\nVPN CAIXA. \r\n\r\nOBS: A VPN automática está ativada e o serviço de telefonia segue operando pela contingência.\r\n\r\nSegue abaixo os servidores de contingência CEF:\r\n\r\nSP: \r\nIP:10.2.1.113\r\nIP:10.2.1.112\r\nIP: 10.2.73.214\r\n\r\nCWB:\r\n10.2.8.234','Incidente',23,1,5,12,'2013-05-21 13:37:47','2013-05-21 17:09:52',1,0,'','[Indisponibilidade MPLS Brasília]',4,'794498201305211001',0,NULL,NULL,NULL,NULL,NULL),(685,'Troca da cabo MPLS','Mudança',30,1,3,12,'2013-05-21 19:37:58','2013-05-21 19:37:58',1,0,'https://docs.google.com/a/brq.com/spreadsheet/ccc?key=0ArHwSavF94mjdGxjbjM4WF9nRUNINzd3QjVOQmZWNGc#gid=1','[Troca do cabo MPLS]',47,'',0,NULL,NULL,NULL,NULL,NULL);
